<!DOCTYPE html>
<html style="height: 100%; margin: 0;">
<head>
    <meta charset="UTF-8">
    <title>Speech Bubble</title>
    <style>
        body {
            margin: 0;
            padding: 0;
            display: flex;
            justify-content: center;
            align-items: center;
            min-height: 100vh;
            background: transparent;
            overflow: visible;
            position: relative;
        }
        
        svg {
            width: 100%;
            max-width: 700px;
            height: auto;
            overflow: visible;
            position: relative;
            z-index: 5;
            transform: translate(130px, -10px);
        }

        .bubble-text {
            font-family: Arial, sans-serif;
            font-size: 11px;
            font-weight: bold;
            color: #333;
            text-align: center;
            width: 225px;
            max-width: 225px;
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(calc(-50% + 130px), calc(-50% + -10px));
            line-height: 1.5;
            z-index: 10;
        }
        
        .speech-bubble {
            fill: white;
            stroke: #333;
            stroke-width: 3;
            z-index: 5;
        }
        
        .image-container {
            position: absolute;
            bottom: 150px;  
            left: 50%;
            transform: translateX(calc(-50% + -90px)) translateY(20px);
            width: 200px;
            height: auto;
            z-index: 1;
        }
        
        .image-container img {
            width: 100%;
            height: auto;
        }
        
        @keyframes bounce {
            0%, 100% { transform: translateY(0); }
            50% { transform: translateY(-15px); }
        }
        
        .bubble-container {
            position: relative;
            animation: bounce 2s ease infinite;
        }
        
        
        body {
            background-color: #ffffff;
        }
        .halftone-bg {
            position: fixed;
            top: 0;
            left: 0;
            width: 100vw;
            height: 100vh;
            z-index: -1;
            pointer-events: none;
            transform: none !important; /* Ensure halftone never moves */
        }
        
        /* Ensure halftone never moves with any other elements */
        .halftone-bg {
            transform: none !important;
        }
    </style>
</head>
